column8:
・可愛いマリンモチーフ刺繍がアクセントの日傘で夏の日差しをしっかりとカット。<br>・生地の裏面にポリウレタン樹脂でコーティング加工をしています。生地の目をしっかりと埋めることで、UVカット・遮光・耐水性に優れています。<br><br>【because(ビコーズ)とは……】<br>Such a Sunny Lovely Day.　Let's go out anytime, anywhere. 太陽が高くなる季節―ビーチサイドのカフェでのんびりしようか　早起きしてマルシェに行こうか　木陰のテラスで読書もしたいな―眩しいくらいの日差しが降り注ぐ快晴の空　大きなバッグにハッピーを詰め込んで　お気に入りの新しい日傘を相棒にさあ出かけましょう　素敵な瞬間をビコーズのレインアイテムとともに―<br><br><br>【商品スペック】<br>[使用時サイズ(全長×直径)]: 約65cm×約81cm<br>[収納時サイズ(全長×直径)]: 約65cm×約10cm<br>[重量]: 約240g<br>[親骨の長さ]: 47cm<br>[親骨の本数]: 8本<br><br>[企画国]: 日本<br>[生産国]: 中国<br>[素材]: 布地/ポリエステル100％(ポリウレタンコーティング), 親骨/鉄, ハンドル/合皮カラーレザー<br>[詳細]: <br>　[UVカット率]: 95％以上<br><br>【販売上の注意】<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
</center>

